import React, { Component } from "react";
import logo from "./logo.svg";
import "./Ziget.css";

export default class Ziget extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="Ziget">
        <header className="Ziget-header">
          <img src={logo} className="Ziget-logo" alt="logo" />
        </header>
        <body>
          <form className="ziget - form">
            <label for="usernames">Username(s):</label>
            <textarea id="usernames" autofocus rows={10} cols={50}></textarea>
          </form>
        </body>
      </div>
    );
  }
}
